const App = () =>{
    const [num,setNum] = useState(1);
    useEffect=()=>{
        document.title=`You clicked me ${num} times`;
    }
return <>
<button onClick={()=>{
    setNum(num+1);
}}>Click Me {num}</button>
</>
};
export default App;
